    [],nt"revision_timestamp": "2016-07-18T22:21:53.029232",nt"name": "commercial-vessel-density-october-2009-2010-ais-national",nt"isopen":
    false,nt"url": null,nt"notes": "These data were generated to provide insight
    into traffic patterns on a macro scale so they could be analyzed across the coastal
    waters of the Continental United States. For this dataset, a transit is counted
    for every unique vessel intersecting a 1 kilometer square grid cell each day. This
    data represents the total number of vessel transits from October 2009 - October
    2010. There were some grid cells which were unable to be processed, but it is not
    perceived that this interferes with the integrity of these data. Please note multiple
    connection errors occurred during the time frame of this study. In most cases, data
    gaps were filled by making subsequent requests to the Coast Guard or other groups
    receiving the same data feed. However, due to resource constraints, uninterrupted
    coverage was not obtained. Overall data outages were minimal, on the order of less
    than a day per month. Because outages were random and affect all areas uniformly,
    they do not have a significant effect on the integrity of the data. As stated on
    the USCG NAIS website, AIS data are not representative of all vessel traffic and
    USCG NAIS receivers do not fully cover the entire extent of this study area. Please
    take time to understand both of these limitations.",nt"license_title": null,nt"extras":
